export const getConfigValue=(e,{tarifnik:t})=>{let r=-1;return t.map((t=>{(e>=t.min&&e<=t.max||e>=t.min&&!t.max)&&(r=t.percent)})),r};export const addValues=e=>{let t=0;return e.forEach((e=>t+=e)),t};export const multiplyNumbers=e=>{let t=0;return e.forEach((e=>t*=e)),t};export const getPercenage=(e,t)=>e/100*t;export const getMonthlyIncomeRate=e=>{let t=1+getPercenage(1,e);return(100*(Math.pow(t,1/12)-1)).toFixed(2)};export const getAccumulatedAmount=(e,t)=>e*(1-getPercenage(1,t));export const getAccumulatedSum=(e,t,r)=>{let o=t/100,n=1+getPercenage(1,t),c=Math.pow(n,r).toFixed(4)-1;getPercenage(c,t);return((c/o).toFixed(2)*n).toFixed(4)};